fill_tpcc_map(){
    tpcc_tests["cleanup_prepare_tpcc"]="sysbench /opt/tools/sysbench-tpcc/tpcc.lua --mysql-host=${host} --mysql-port=${port}  --mysql-user=${user} --mysql-password=${passwprd} --mysql-db=tpcc --db-driver=mysql --tables=${TPCc_TABLES} --scale=${WHAREHOUSES} --report-interval=1 --mysql-ignore-errors=none --histogram --report_csv=yes  --stats_format=csv --db-ps-mode=disable --threads=1"
    tpcc_tests["run_tpcc_RepeatableRead"]="sysbench /opt/tools/sysbench-tpcc/tpcc.lua --mysql-host=${host} --mysql-port=${port}  --mysql-user=${user} --mysql-password=${passwprd} --mysql-db=tpcc --db-driver=mysql --tables=${TPCc_TABLES} --scale=${WHAREHOUSES} --time=${time} --rand-type=uniform --report-interval=1 --mysql-ignore-errors=none --histogram --report_csv=yes  --stats_format=csv --db-ps-mode=disable --trx_level=RR --threads=${threads} --enable_purge=yes "
    tpcc_tests["run_tpcc_ReadCommitted"]="sysbench /opt/tools/sysbench-tpcc/tpcc.lua --mysql-host=${host} --mysql-port=${port}  --mysql-user=${user} --mysql-password=${passwprd} --mysql-db=tpcc --db-driver=mysql --tables=${TPCc_TABLES} --scale=${WHAREHOUSES} --time=${time} --rand-type=uniform --report-interval=1 --mysql-ignore-errors=none --histogram --report_csv=yes  --stats_format=csv --db-ps-mode=disable --trx_level=RC --threads=${threads} --enable_purge=yes"
}